INSERT INTO `article` VALUES ('1584903369666535425', '高淳博物馆', '<p>高淳博物馆建筑面积5500㎡，馆藏文物30000余件，其中重要文物2000余件。博物馆基本陈列以“水绿山青，风高民淳”为主题，展示高淳的历史人文生态。分为“原始聚落•上古城邑”、“水工兴利•圩田稼穑”、“天地人神•精神世界”、“流民播迁•族群社居”、“口传心声•文化语境”、“地产风物•人文遗珍”六个单元。展览内容有：一万多年前的动植物化石；距今6300多年前的新石器时代“薛城遗址”的生活场景复原；伍子胥开挖世界上最古老人工运河之一——胥河的场景复原；以及比石头城早建208年的古固城场景复原和高淳老街的场景复原和3D显示；高淳道教神像画和重要非遗大马灯、跳五猖图像和光影显示；高淳作为江南水乡的历史治水壮举和现代两大支柱产业水运（含造船业）和螃蟹养殖的场景再现；被称为“古汉语活化石”的高淳方言以及高淳民风民俗的展览展示等进入高淳博物馆，你将在短时间内穿越高淳上万年历史,全面了解高淳历史文化和人文生态。</p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/8893444e60784cd496868b5fd5f4d3cd5.webp\" alt=\"高淳博物馆\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/71b57052e44f40b5aeb5e7ef7becfdd01.webp\" alt=\"高淳博物馆\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/ef344754b8104911bcef1f7846277e1f2.webp\" alt=\"高淳博物馆\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/5bf47726d1c04e3b8b7708ba66a6b73c4.webp\" alt=\"高淳博物馆\" /></p>\n', '高淳博物馆建筑面积5500㎡，馆藏文物30000余件，其中重要文物2000余件。博物馆基本陈列以“水绿山青，风高民淳”为主题，展示高淳的历史人文生态。分为“原始聚落•上古城邑”、“水工兴利•圩田稼穑”、“天地人神•精神世界”、“流民播迁•族群社居”、“口传心声•文化语境”、“地产风物•人文遗珍”六个单元。展览内容有：一万多年前的动植物化石；距今6300多年前的新石器时代“薛城遗址”的生活场景复原；伍子胥开挖世界上最古老人工运河之一——胥河的场景复原；以及比石头城早建208年的古固城场景复原和高淳老街的场景复原和3D显示；高淳道教神像画和重要非遗大马灯、跳五猖图像和光影显示；高淳作为江南水乡的历史治水壮举和现代两大支柱产业水运（含造船业）和螃蟹养殖的场景再现；被称为“古汉语活化石”的高淳方言以及高淳民风民俗的展览展示等进入高淳博物馆，你将在短时间内穿越高淳上万年历史,全面了解高淳历史文化和人文生态。\n\n![高淳博物馆](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/8893444e60784cd496868b5fd5f4d3cd5.webp)\n\n![高淳博物馆](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/71b57052e44f40b5aeb5e7ef7becfdd01.webp)\n\n![高淳博物馆](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/ef344754b8104911bcef1f7846277e1f2.webp)\n\n![高淳博物馆](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/5bf47726d1c04e3b8b7708ba66a6b73c4.webp)\n\n', '景点', '1533769969991442433', 0, '2022-10-25 21:43:04', '2022-10-25 21:43:04');
INSERT INTO `article` VALUES ('1584903800631271425', '高淳老街', '<p>高淳老街是中国古街中的一颗灿烂的明珠。老街宋代已见雏形，明清两代依托官溪河的水运便利，因商立街，逐渐繁华。历经500多年的岁月更迭，至今存留了一条长800余米（最初为1135米），宽4米左右，核心区面积7.6公顷、片区面积1.2平方公里的古老街道，为江苏省目前保存最为完好的明清古街之一、国家AAAA级旅游景区、省级文物保护单位。2012年高淳老街成功入选“全国十大历史文化名街”。高淳老街展现了古老瑰丽的古建筑艺术及深厚的民间民俗文化。粉墙青瓦鳞次栉比，飞檐翘角突兀多姿，砖木石雕满目琳琅，雕梁画栋堂皇富丽，招牌书法多姿绚丽，山墙壁画浓郁芬香，被中外学者游客誉为“东方文明之缩影”、“古建筑的艺术宝库”、“中国民俗文化富矿区”。延续老街古朴肌理，新打造的曼度·老街东休闲街区集餐饮、客栈、酒吧、咖啡、文创精品等为一体，华灯初上，霓虹闪烁，为老街夜生活增添了一份独特的魅力。</p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/5c1525950f234b71a4d1148bcc77280b6.webp\" alt=\"高淳老街\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/6120c0670245445684ef2568c536a13f1.webp\" alt=\"高淳老街\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/0d85234a5382463b816078f0ee922c744.webp\" alt=\"高淳老街\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/3bcba0c83cd2439fa29b5f27fbddcff23.webp\" alt=\"高淳老街\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/4b8e0a9f94b94df2a56de80ab8cf02732.webp\" alt=\"高淳老街\" /></p>\n', '高淳老街是中国古街中的一颗灿烂的明珠。老街宋代已见雏形，明清两代依托官溪河的水运便利，因商立街，逐渐繁华。历经500多年的岁月更迭，至今存留了一条长800余米（最初为1135米），宽4米左右，核心区面积7.6公顷、片区面积1.2平方公里的古老街道，为江苏省目前保存最为完好的明清古街之一、国家AAAA级旅游景区、省级文物保护单位。2012年高淳老街成功入选“全国十大历史文化名街”。高淳老街展现了古老瑰丽的古建筑艺术及深厚的民间民俗文化。粉墙青瓦鳞次栉比，飞檐翘角突兀多姿，砖木石雕满目琳琅，雕梁画栋堂皇富丽，招牌书法多姿绚丽，山墙壁画浓郁芬香，被中外学者游客誉为“东方文明之缩影”、“古建筑的艺术宝库”、“中国民俗文化富矿区”。延续老街古朴肌理，新打造的曼度·老街东休闲街区集餐饮、客栈、酒吧、咖啡、文创精品等为一体，华灯初上，霓虹闪烁，为老街夜生活增添了一份独特的魅力。\n\n![高淳老街](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/5c1525950f234b71a4d1148bcc77280b6.webp)\n\n![高淳老街](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/6120c0670245445684ef2568c536a13f1.webp)\n\n![高淳老街](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/0d85234a5382463b816078f0ee922c744.webp)\n\n![高淳老街](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/3bcba0c83cd2439fa29b5f27fbddcff23.webp)\n\n![高淳老街](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/4b8e0a9f94b94df2a56de80ab8cf02732.webp)\n\n', '景点', '1533770426839228418', 0, '2022-10-25 21:44:47', '2022-10-25 21:44:47');
INSERT INTO `article` VALUES ('1584904056110522370', '保圣寺塔', '<p>保圣寺塔相传建于东吴赤乌二年（239年），位于高淳区城东郊，是至今我省保存历史最久的两座方塔（另一座为常熟崇教寺方塔）之一，是江苏省级文物保护单位，也是古城高淳的一个标志性建筑。该塔造型为四方七级，砖木结构楼阁式，总高33.5米。人们入园站在塔下仰望塔身，只见飞檐蔽日，翘角凌云，塔刹挺拔，直冲九霄。各层翼角所悬铜铃，铃声如环击佩鸣，声声入耳，令人心驰神往。据说佛塔风铃因人施鸣，迷者闻之百感交集，行恶即止；智者听之朝善而行，倍加珍惜时光，顺梯登临顶室，朝窗举目四望，淳溪古镇公路纵横密如蛛网，市区幢幢高楼耸立，一派欣欣向荣的景象。南固城、北石臼，波光粼粼，湖边花山、游山姿容秀丽，东面田野风光也历历在目。登高观景，倍觉心胸开朗，意境无涯。</p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/eb42c2a01f554bf6bc052064e0b878835.webp\" alt=\"保圣寺塔\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/67e566980d284bdb83880db5f2f9de066.webp\" alt=\"保圣寺塔\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/69248cdeeaa1487d8a304947cacb9adc2.webp\" alt=\"保圣寺塔\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/d13f48261e054695906b251c94fb39a33.webp\" alt=\"保圣寺塔\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E6%99%AF%E7%82%B9/a5ae3b65b3ac41f796d9585181cd99fa1.webp\" alt=\"保圣寺塔\" /></p>\n', '保圣寺塔相传建于东吴赤乌二年（239年），位于高淳区城东郊，是至今我省保存历史最久的两座方塔（另一座为常熟崇教寺方塔）之一，是江苏省级文物保护单位，也是古城高淳的一个标志性建筑。该塔造型为四方七级，砖木结构楼阁式，总高33.5米。人们入园站在塔下仰望塔身，只见飞檐蔽日，翘角凌云，塔刹挺拔，直冲九霄。各层翼角所悬铜铃，铃声如环击佩鸣，声声入耳，令人心驰神往。据说佛塔风铃因人施鸣，迷者闻之百感交集，行恶即止；智者听之朝善而行，倍加珍惜时光，顺梯登临顶室，朝窗举目四望，淳溪古镇公路纵横密如蛛网，市区幢幢高楼耸立，一派欣欣向荣的景象。南固城、北石臼，波光粼粼，湖边花山、游山姿容秀丽，东面田野风光也历历在目。登高观景，倍觉心胸开朗，意境无涯。\n\n![保圣寺塔](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/eb42c2a01f554bf6bc052064e0b878835.webp)\n\n![保圣寺塔](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/67e566980d284bdb83880db5f2f9de066.webp)\n\n![保圣寺塔](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/景点/69248cdeeaa1487d8a304947cacb9adc2.webp)