INSERT INTO `article` VALUES ('1584904718886051842', '高淳大闸蟹', '<p>蟹是美味，人人喜爱，无间南北，不分雅俗。来到高淳，怎能不品蟹？作为高淳最出名的美食，固城湖大闸蟹声名远扬。每到秋季，便有大批游人慕名而来。一盘热气腾腾的大闸蟹端上来，蟹的外壳已经蒸的金黄，那是一种绚烂的颜色。透过热气便是大闸蟹诱人的香气，让人急不可耐的想要拿起它。拨开外壳，黄灿灿的蟹黄让人垂涎欲滴，远远望去，就如同一块块金子。用勺子舀一点醋放在蟹盖里，酸溜溜的醋配上蟹黄十分美味。厚厚的一团蟹黄放在嘴里，满足感油然而起。吃完蟹黄，慢慢地拨开蟹肚上的绒毛，敲碎外壳，里面的肉细嫩而整齐，咬上去滑滑嫩嫩，让人欲罢不能。将蟹腿剪成三截，最末一截蟹脚尖可充当工具。再用蟹脚尖细的那一头把蟹腿中段的肉捅出来，然后用蟹脚尖粗的那一头把蟹腿前段的肉捅出来，便可完整地吃完一只蟹。固城湖螃蟹需要慢慢地品尝，犹如高淳的慢生活，需要慢下来，才能享受。品蟹是一门慢艺术，君子吃料尝之味，食之有度，才能慢慢体会大闸蟹丰腴圆润的口感，啖啖浓郁之香。</p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/c615d7e0773c4ad3bd8c500509be32e06.webp\" alt=\"固城湖螃蟹\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/8041e40cfcd048c1801404ce2f42f4451.webp\" alt=\"固城湖螃蟹\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/47e240f9c7ce46469d2dbcf0c42c8e353.webp\" alt=\"固城湖螃蟹\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/b066005d0f154b2fb8f147ea8c7ed25d5.webp\" alt=\"固城湖螃蟹\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/69f70d8117d94b6a8f4565481c9700962.webp\" alt=\"固城湖螃蟹\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/40c6f1d3e1a54a08a8824f2929e290754.webp\" alt=\"固城湖螃蟹\" /></p>\n', '蟹是美味，人人喜爱，无间南北，不分雅俗。来到高淳，怎能不品蟹？作为高淳最出名的美食，固城湖大闸蟹声名远扬。每到秋季，便有大批游人慕名而来。一盘热气腾腾的大闸蟹端上来，蟹的外壳已经蒸的金黄，那是一种绚烂的颜色。透过热气便是大闸蟹诱人的香气，让人急不可耐的想要拿起它。拨开外壳，黄灿灿的蟹黄让人垂涎欲滴，远远望去，就如同一块块金子。用勺子舀一点醋放在蟹盖里，酸溜溜的醋配上蟹黄十分美味。厚厚的一团蟹黄放在嘴里，满足感油然而起。吃完蟹黄，慢慢地拨开蟹肚上的绒毛，敲碎外壳，里面的肉细嫩而整齐，咬上去滑滑嫩嫩，让人欲罢不能。将蟹腿剪成三截，最末一截蟹脚尖可充当工具。再用蟹脚尖细的那一头把蟹腿中段的肉捅出来，然后用蟹脚尖粗的那一头把蟹腿前段的肉捅出来，便可完整地吃完一只蟹。固城湖螃蟹需要慢慢地品尝，犹如高淳的慢生活，需要慢下来，才能享受。品蟹是一门慢艺术，君子吃料尝之味，食之有度，才能慢慢体会大闸蟹丰腴圆润的口感，啖啖浓郁之香。\n\n![固城湖螃蟹](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/c615d7e0773c4ad3bd8c500509be32e06.webp)\n\n![固城湖螃蟹](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/8041e40cfcd048c1801404ce2f42f4451.webp)\n\n![固城湖螃蟹](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/47e240f9c7ce46469d2dbcf0c42c8e353.webp)\n\n![固城湖螃蟹](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/b066005d0f154b2fb8f147ea8c7ed25d5.webp)\n\n![固城湖螃蟹](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/69f70d8117d94b6a8f4565481c9700962.webp)\n\n![固城湖螃蟹](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/40c6f1d3e1a54a08a8824f2929e290754.webp)\n\n', '美食', '1533775128150695938', 0, '2022-10-25 21:48:26', '2022-10-25 21:48:26');
INSERT INTO `article` VALUES ('1584904859340709890', '蟹黄汤包', '<p>漫步高淳老街，你肯定会被一簇簇的热气和长长的排队等待的人群勾起好奇心，是什么吸引了这么多人？那就是高淳著名的小吃蟹黄汤包。忍不住叫上两屉，只见一只汤包卧在小小的碟子里，汤包十分的饱满、圆滑，顶端的熠皱层层叠叠，细黄的姜丝躺在底下，黑色的醋均匀地洒在汤包的四周。白、黄、黑三种色调，明快亮丽地构成了一幅抽象画，蟹黄汤包香气四溢，带着螃蟹的鲜香，合着醋的浓香，混着姜丝的清香，让人情不自禁的深吸一口气，真是沁人心脾。**轻轻地在汤包上面咬上一个小口，冷却一会儿，再慢慢地吸着里面的蟹汤，闭上眼睛，细细品尝，缓缓回味，就会感到鲜香无比。喝完汤后，便可以看见一小块一小块金黄色、橘红色的蟹黄和白色的细嫩蟹肉。和着汤包皮一起咀嚼着，面皮的清香，螃蟹的浓香，真是相得益彰！在慢慢的美食享受中，仿佛融入了老街上空那一团团热气，融入了高淳的情怀中……</p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/c7590c81ae09459daeaa7515e135b0bc1.webp\" alt=\"蟹黄汤包\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/59eae93c740d43d29becc372c7ee97de7.webp\" alt=\"蟹黄汤包\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/9876dcf5176349b1b9ac6b75d9a0d5e25.webp\" alt=\"蟹黄汤包\" /></p>\n<p><img src=\"https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/%E7%BE%8E%E9%A3%9F/52aa07034d674f28b3c990f7dcac32178.webp\" alt=\"蟹黄汤包\" /></p>\n', '漫步高淳老街，你肯定会被一簇簇的热气和长长的排队等待的人群勾起好奇心，是什么吸引了这么多人？那就是高淳著名的小吃蟹黄汤包。忍不住叫上两屉，只见一只汤包卧在小小的碟子里，汤包十分的饱满、圆滑，顶端的熠皱层层叠叠，细黄的姜丝躺在底下，黑色的醋均匀地洒在汤包的四周。白、黄、黑三种色调，明快亮丽地构成了一幅抽象画，蟹黄汤包香气四溢，带着螃蟹的鲜香，合着醋的浓香，混着姜丝的清香，让人情不自禁的深吸一口气，真是沁人心脾。**轻轻地在汤包上面咬上一个小口，冷却一会儿，再慢慢地吸着里面的蟹汤，闭上眼睛，细细品尝，缓缓回味，就会感到鲜香无比。喝完汤后，便可以看见一小块一小块金黄色、橘红色的蟹黄和白色的细嫩蟹肉。和着汤包皮一起咀嚼着，面皮的清香，螃蟹的浓香，真是相得益彰！在慢慢的美食享受中，仿佛融入了老街上空那一团团热气，融入了高淳的情怀中……\n\n![蟹黄汤包](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/c7590c81ae09459daeaa7515e135b0bc1.webp)\n\n![蟹黄汤包](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/59eae93c740d43d29becc372c7ee97de7.webp)\n\n![蟹黄汤包](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/9876dcf5176349b1b9ac6b75d9a0d5e25.webp)\n\n![蟹黄汤包](https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagand