INSERT INTO `hotel` VALUES ('1584877947092434946', '喵姐的花园民宿', '在这里，喵姐精心打造小小花园，充满鲜花绿意的庭院助您逃离城市的压力，仿佛来到人间桃花源。柔软舒适的床被，带您进入温柔乡，松弛每一根紧绷的神经。', 'https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/旅馆/9a39aa7ff6314fe988d9829f6ca7e8266.webp', 5, 'qaq', '13411111111', 0, '2022-10-25 20:02:03', '2022-10-25 20:45:47');
INSERT INTO `hotel` VALUES ('1584884694259568642', '素一花园民宿', '民宿坐落在风景秀丽的国际慢城中，背靠万亩茶园，春天油菜花盛开，这里有一年一度的金花节，秋天果实累累时，有固城湖螃蟹节，周边有游子山、武家嘴风情谷、森林公园，湿地公园，还有政府修建的慢跑道，宜动宜静。', 'https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/旅馆/09d6d5e643dd4a518130860f471d36281.webp', 4, '123qaqq', '15211111111', 0, '2022-10-25 20:28:52', '2022-10-25 20:45:35');
