INSERT INTO `operate_log` VALUES ('1584895257119236097', 'admin', '0', '站点管理', '根据线路id查询线路所有站点信息', '2022-10-25 21:10:50', 'R(success=true, code=20000, message=成功, data={items=[RouteDetail(id=1533781742832345090, routeId=1533781557964201986, site=桠溪国际慢城, sort=1, startTime=07:01:43, endTime=16:03:49, description=7:00 集合快乐出发\n\n9:00 到达高淳国际慢城游客中心，换乘景交车游览景区。景交路线途经慢乐园，可以在此下车体验树冠漫步项目。\n\n10:00 游玩结束，继续乘坐观光车文化林广场下车，步行前往金花地，观赏金花花海、二月兰等景区风光。在桃花扇广场或者慢城大草坪拍照留念。\n\n11:30 前往大山村，欣赏最美乡村风光，品味慢城慢生活，享受享用地道的农家风味。\n\n13:30 乘坐观光车返回。\n\n14:30 出发前往游子山三条垄，观赏万亩茶园风光。\n\n16:00 集合，快乐返程, isDeleted=0, createTime=Mon Jun 06 20:03:58 CST 2022, modifyTime=Mon Jun 06 20:03:58 CST 2022)]})', '[本机地址, 本机地址, ]', '127.0.0.1');
