INSERT INTO `operate_log` VALUES ('1584904326886400001', 'admin', '0', '美食管理', '分页查询美食', '2022-10-25 21:46:52', 'R(success=true, code=20000, message=成功, data={total=6, items=[Delicacy(id=1533776335044894721, name=青团, description=每年清明前后，是采摘破絮果草的最佳时节，高淳人采来之后将其捣尖回绕。qaq, cover=https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/4aa4b907893a4adeba00e9fbe76a77423.webp, recommendRank=3, isDeleted=0, createTime=Mon Jun 06 19:42:29 CST 2022, modifyTime=Tue Oct 25 20:52:15 CST 2022), Delicacy(id=1533776168732352513, name=千里香, description=“千里香”，一个高雅而别致的名字，外地多了。这种吃特产。\n, cover=https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/1ef248fac3884850a238d7509675ef415.webp, recommendRank=3, isDeleted=0, createTime=Mon Jun 06 19:41:49 CST 2022, modifyTime=Tue Oct 25 20:52:26 CST 2022), Delicacy(id=1533775926498713602, name=固城湖水八仙, description=水八仙是高淳地区的传统食物，又称水八鲜，包括茭白、莲藕、水芹、芡实(鸡头米)、茨菰尝到鲜美的水八！, cover=https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/1d3ca62c1442461d884d5a63f8a266d44.webp, recommendRank=4, isDeleted=0, createTime=Mon Jun 06 19:40:52 CST 2022, modifyTime=Tue Oct 25 20:52:29 CST 2022), Delicacy(id=1533775663847202817, name=豆腐丸子, description=丸子，在全国各地的餐桌上盛行，彰显着它的无穷魅力和美味，在高淳，的用料极为那腐。豆腐。, cover=https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/529ff41ad9004dd2abd586b82e53c27a4.webp, recommendRank=3, isDeleted=0, createTime=Mon Jun 06 19:39:49 CST 2022, modifyTime=Tue Oct 25 20:52:32 CST 2022), Delicacy(id=1533775398192570369, name=蟹黄汤包, description=234, cover=https://edu-19527.oss-cn-nanjing.aliyuncs.com/travel_GaoChun/propagandist/photos/美食/52aa07034d674f28b3c990f7dcac32178.webp, recommendRank=5, isDeleted=0, createTime=Mon Jun 06 19:38:46 CST 2022, modifyTime=Tue Oct 25 20:52:37 CST 2022)]})', '[本机地址, 本机地址, ]', '127.0.0.1');
